import React from "react";

function NavBar(){
    return (
       <nav className="navbar">
            <div className="container">
                <div className="navbar_container">
                    <ul className="navbar_left">
                        <div className="navbar_left-logo">
                            <img src="" alt="" />
                        </div>
                    </ul>
                </div>
            </div>
       </nav>
    )
}
export default NavBar;
